import React from 'react';
import './Header.css';
import Navbar from '../Navbar/Navbar';

const Header = () => {
    return (
        <div>
            <Navbar />
            <section className="container py-3">
                {/* <input type="email" class="form-control w-50  d-inline-block" />
            <button type="submit" class="btn btn-primary ml-3">Submit</button> */}

                <div class="form-group row">
                    {/* <label for="inputEmail4">FirstName</label> */}
                    <input type="" class="form-control  col-md-4" id="inputEmail4" />
                    {/* <input type="" class="form-control  col-md-6" id="inputEmail4" /> */}
                    <button type="submit" class="btn btn-primary form-control  col-md-4 ml-3">Submit</button>
                </div>
            </section>
        </div>
    );
};

export default Header;
